//https://leetcode.com/problems/accounts-merge
class Solution {
public:
    unordered_map<int, int> parent;
    int find(int node){
        int p = parent[node];
        while(p != node){
            node = p;
            p = parent[node];
        }
        return p;
    }
    void merge(int node1, int node2){
        int p1 = find(node1);
        int p2 = find(node2);
        if(p1 == p2)return;
        parent[p1] = p2;
    }
    vector<vector<string>> accountsMerge(vector<vector<string>>& accounts) {
        unordered_map<string, int> m;
        for(int i=0; i<accounts.size(); i++){
            parent[i] = i;
        }
        for(int k=0; k<accounts.size(); k++){
            for(int i=1; i<accounts[k].size(); i++){
                if(m.count(accounts[k][i])){
                    merge(k, m[accounts[k][i]]);
                }else
                    m[accounts[k][i]] = k;
            }
        }
        unordered_map<int, pair<string, set<string>>> m_index_name_email;
        for(auto email: m){
            int index = find(email.second);
            set<string> s(accounts[email.second].begin()+1, accounts[email.second].end());
            if(!m_index_name_email.count(index)){
                m_index_name_email[index] = {accounts[index][0], s};
            }else{
                m_index_name_email[index].second.insert(s.begin(), s.end());
            }
        }

        vector<vector<string>> res;
        for(auto a: m_index_name_email){
            auto [name, email] = a.second;
            vector<string> v;
            v.push_back(name);
            v.insert(v.end(), email.begin(), email.end());
            res.push_back(v);
        }
        return res;
    }
};

